import React from "react";
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";

function About() {
  const parts = async (engine) => {
    await loadFull(engine);
  };

  return (
    <div>
      <Particles
        init={parts}
        options={{
          fullScreen: { enable: true, zIndex: -1 },
          background: { color: "#000" },
          particles: {
            number: { value: 50 },
            shape: { type: "circle" },
            opacity: { value: 0.8 },
            size: { value: 3 },
            move: { enable: true, speed: 2 },
            color: { value: "#FF0000" },
            links: { enable: true, distance: 100, color: "#ffffff", opacity: 0.5 },
          },
        }}
      />
    </div>
  );
}

export default About;
